import React, { useState } from "react";
import { Button, Box } from "@mui/material";
import PublicProductList from "./components/PublicProductList";
import InternalProductList from "./components/InternalProductList";

function App() {
  const [view, setView] = useState("public");

  return (
    <Box sx={{ p: 2 }}>
      <Box sx={{ mb: 2 }}>
        <Button variant="contained" onClick={() => setView("public")} sx={{ mr: 1 }}>
          Public View
        </Button>
        <Button variant="contained" onClick={() => setView("internal")}>
          Internal View
        </Button>
      </Box>
      {view === "public" ? (
        <PublicProductList onManage={() => setView("internal")} />
      ) : (
        <InternalProductList onBack={() => setView("public")} />
      )}
    </Box>
  );
}

export default App;
